import logo from './logo.svg';
import './App.css';
import Home from './Components/Home';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path='/' />
        </Routes>
        <Home />
      </div>
    </Router>
  );
}

export default App;
